import React from "react";

export default function Projects() {
  const projects = [
    { title: "Project One", desc: "Description of project one", link: "#" },
    { title: "Project Two", desc: "Description of project two", link: "#" },
    { title: "Project Three", desc: "Description of project three", link: "#" },
  ];

  return (
    <section id="projects" className="py-20 px-6 bg-black text-white">
      <h3 className="text-3xl font-bold mb-6 text-purple-400">Projects</h3>
      <div className="grid md:grid-cols-3 gap-6">
        {projects.map((p, i) => (
          <div
            key={i}
            className="bg-gray-900 p-6 rounded-lg hover:shadow-lg hover:shadow-purple-500/20"
          >
            <h4 className="text-xl font-bold mb-2 text-blue-300">{p.title}</h4>
            <p className="text-gray-300 mb-4">{p.desc}</p>
            <a
              href={p.link}
              className="text-purple-400 hover:text-purple-300"
            >
              View Project â†’
            </a>
          </div>
        ))}
      </div>
    </section>
  );
}
